import React from 'react'

function AccountComponent({bankRaw}) {
    const bankElement = bankRaw.map(bank=>{
        return(
            <div style={{width: "100%"}}>
              <h2>{bank.bank_name}</h2>
              <div className='bank_account_container'>
                {bank.accounts.map(account=>{
                  return(
                  <div>
                      <h4>{account.account_type}</h4>
                      <p style={{color: "white"}}>{account.account_value}</p>
                    </div>)
                      }
                    )
                  }

              </div>

            </div>
        )
    })
  return (
    <div className='background_wrapper'>
        <div className='_wrapper'>
          <div className='bank_id'>
            {bankElement}
          </div>
        </div>

      </div>
  )
}

export default AccountComponent
